            dem:0
        };
      }
     Next = () => {
         
        this.setState({
            dem:this.state.dem+1,
            new: ["col none",'col none','col none','col none','col none','col none'],
        });
        var newAaray =this.state.new;
            newAaray
    }
    render(){
        return(
            <div className="new-top">
